import React from 'react'
import './NotesContainer.css'
import Note from '../Note/Note'
import notesData from '../../Data'

export default function NotesContainer() {
  return (
    <div className='container'>
        <div className='notesContainer'>
            {notesData.map((note)=>{
                <Note 
                    title={note.title}
                    desc={note.desc}
                />
            })}
        </div>
    </div>

  )
}
